function g(t){const r=String(t.getHours()).padStart(2,"0"),n=String(t.getMinutes()).padStart(2,"0"),a=String(t.getDate()).padStart(2,"0"),o=String(t.getMonth()).padStart(2,"0"),e=String(t.getFullYear()).padStart(4,"0");return`${r}:${n} ${a}/${o}/${e}`}function S(t){const r=String(t.getDate()).padStart(2,"0"),n=String(t.getMonth()+1).padStart(2,"0"),a=String(t.getFullYear()).padStart(4,"0");return`${r}/${n}/${a}`}function i(t){const r=String(t.getDate()).padStart(2,"0"),n=String(t.getMonth()+1).padStart(2,"0");return`${String(t.getFullYear()).padStart(4,"0")}-${n}-${r}`}export{g as a,i as b,S as f};
